  query {
    characters {
      results {
        id
        name
        image
      }
    }
  }
`;
const ImageList = () => {
  const { error, data, loading } = useQuery(GET_CHARACTERS);
  console.log({ error, data, loading });
  if (loading) return <div>spinner...</div>;
  return <div>hi list</div>;
};

export default ImageList;
